import React from "react";
import PropTypes from 'prop-types'

function Card({ nombre, imagen }) {
    const imagePath = require(`../assets/${imagen}`);
    return (
        <div className="card text-center bg-dark animate__animated animate__fadeInUp">
            <div className="overflow container-fluid">
                <img src={imagePath} className="card-img img-fluid" alt="" />
            </div>
            <div className="card-body">
                <h4 className="card-title">{nombre}</h4>
                <p className="card-text text-secondary">Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) </p>
                <a href="https://example.com" className="btn btn-outline-secondary rounded-0">
                    Go to this website
                </a>
            </div>
        </div>
    )
}
Card.propTypes = {
    nombre: PropTypes.string.isRequired,
    imagen: PropTypes.string
}
export default Card;
